    //const center = useMemo(()=>({lat:48, lng: 2}), []);
    return (
      <>
      <GoogleMap zoom={2} center={{ lat: 45, lng: 2.5 }} mapContainerClassName="map-container">
      <Markers obj={data}/>
      </GoogleMap>
      </>
    );

  }
